/** @format */

import React from 'react';
import ReactDom from 'react-dom';
import './styles.css';

/*
function sum(a, b) {
	return a + b;
}

function primeiroJSX() {
	//	/* prettier-ignore
	return (
    <div className='teste'>
        <h2> Introdução ao React - DIO </h2>
		<p>Soma: {sum(29, 13)}</p>
    </div>
    )
}
*/
const elemento = <h2>Renderização</h2>;

const App = () => {
	// prettier-ignore

	return (
	<div className="App">
		
		{elemento}
		</div>
	)
};

const rootElement = document.getElementById('root');
ReactDom.render(<App />, rootElement);
